        'training_requirement' => 'NGS Includes high throughput nucleic acid sequencing technologies such as illumina (Miniseq) and proton/ion personal genome sequencing (PGM)
Illumina next-generation sequencing utilizes a fundamentally different approach from the classic Sanger chain-termination method. It leverages sequencing by synthesis (SBS) technology – tracking the addition of labeled nucleotides as the DNA chain is copied – in a massively parallel fashion.
Illumina NGS workflows include four basic steps: 
1. Library Preparation—The sequencing library is prepared by random fragmentation of the DNA or cDNA sample, followed by adapter ligation. Adapter-ligated fragments are then PCR amplified and gel purified. 
2. Cluster Generation—For cluster generation, the library is loaded into a flow cell where fragments are captured on a lawn of surface-bound oligos complementary to the library adapters. Each fragment is then amplified into distinct, clonal clusters through bridge amplification. When cluster generation is complete, the templates are ready for sequencing. 
3. Sequencing—IlluminaSBStechnology uses a proprietary reversible terminator–based method that detects single bases as they are incorporated into DNA template strands. As all four reversible terminator–bound dNTPs  are present during each sequencing cycle, natural competition  minimizes in corporation  bias and greatly reduces raw error rates. The result is highly accurate base-by-base sequencing that virtually eliminates sequence context–specific errors, even within repetitive sequence regions and homopolymers.
4. Data Analysis—During  data analysis and alignment, the newly identified sequence reads are aligned toa reference genome. Following alignment, many variations of analysis are possible',
